import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';

import { MobileRoutingModule } from './mobile-routing.module';


@NgModule({
  declarations: [],
  imports: [
    CommonModule,
    MobileRoutingModule
  ]
})
export class MobileModule { }
